import './App.css';
import { Container, Typography, Box } from '@mui/material'
import Homepage from './pages/Homepage'
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <>
    <Container>
      <Box>
        <Typography>Hello</Typography>
        <BrowserRouter>
          <Homepage/>
        </BrowserRouter>
      </Box>
    </Container>
    </>
  );
}

export default App;
